        const id=btnRef.current.value;
        await axios.delete(`http://localhost:8080/electronics/${id}`)
        .then(res=>console.log(res));
    }
  return (
    <>
    <Nav />

    <div className='delete'>

    <input type="text"  ref={btnRef}/>
      <button onClick={btn}>
        Delete
      </button>


    </div>


    <div className='elec-wrap'>

{data.map((items)=>

